import React from "react";

function TodoList(props) {
  return (
    // list-todos
    <li className="list-i"> 
      {props.item}
      <span className="icons">
        <i
          className="fa-solid fa-trash-can" //icon
          onClick={(e) => {
            props.deleteItem(props.index);
          }}
        ></i>
      </span>
    </li>
  );
}

export default TodoList;
